import React from 'react'

import HomeNav from '../Component/Home/HomeNav'

import HomeFooter from '../Component/Home/HomeFooter';
import ImageBanner from '../Component/Home/ImageBanner';
import { Container } from 'react-bootstrap';


import './Home.css';


export default function Home() {
  return (
    <>
      <HomeNav />
      <ImageBanner/>
      <Container fluid className='justify-content-md-center text-dark'>
        <h1>Effortless Note-Taking and Seamless Sketching</h1>
      </Container>
      <HomeFooter/>
    </>
  )
}
